import { searchById } from '../../redux/action';




const Detail = () => {
    const { id } = useParams();
    console.log(id);
    const dispatch = useDispatch()
    const dogById = useSelector(state => state.dogsById(id))
   console.log(dogById)


    useEffect(() => {
        dispatch(searchById(id))
    }, [id]);

    return (
    <div>
        <div className="Detail">
            <card>
                <h2>{dogById}</h2>
            </card>
        </div>
    </div>
    )
}

export default Detail
